import React from 'react'
import './Header.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faSearch } from '@fortawesome/free-solid-svg-icons'
import { faUserPlus } from '@fortawesome/free-solid-svg-icons'
import { faBell } from '@fortawesome/free-solid-svg-icons'
function Header() {
    return (
      <div>
        
            <h1 className="icon">&#9776;</h1>
      
        <div className="box">
            <FontAwesomeIcon icon={faSearch} className="searchicon"/>
            <input type="text" name="" className="search" placeholder="dfin"></input>
        </div>
        <div className="rightmenus">
        <FontAwesomeIcon icon={faUserPlus} className="right2"/>
        <button type="button" className="right">INVITE TEAM MEMBER</button>
        <FontAwesomeIcon icon={faBell} className="right3"/>
        </div>
      </div>
    );
  }
  
  export default Header;
